def clean(transdf):
    regexdf = pd.DataFrame( index=range(len(transdf.index)), columns=["id","Meta","Transmeta","CleanMeta1"])
    regexdf = regexdf.fillna("")
    
    for i in range(len(transdf.index)):
        regexdf.iloc[i,0]=transdf.iloc[i,0]
        regexdf.iloc[i,1]=transdf.iloc[i,1]
        regexdf.iloc[i,2]=transdf.iloc[i,2]
        
        temptxt=re.sub('[^A-Za-z0-9 ]+', ' ', transdf.iloc[i,2])
        regexdf.iloc[i,3]=' '.join(temptxt.split()).lower()
        
        
        
#    regexdf.to_csv('D:/Working/Auto-sub cat modelling/SVM/SVM/clean_translated.csv', encoding='utf-8')
    
    # =============================================================================
    # ###Reading Stopwords###
    # =============================================================================
    stop_words=pd.read_csv('C:/Server backup/VIDOOLY NILANJAN/Python/Translate/stop_words.csv',encoding='utf-8',header=None)
    stop_word=[]
    for i in range(len(stop_words)):
        stop_word.append(stop_words.iloc[i,0])
        
    stpdf = pd.DataFrame(index=range(len(regexdf.index)), columns=["id","Meta","Transmeta","stopword_cleaned"])
    stpdf = stpdf.fillna("")
    
    # =============================================================================
    # ### Removing stopwords###
    # =============================================================================
    for i in range(len(regexdf.index)):
        stpdf.iloc[i,0]=regexdf.iloc[i,0]
        stpdf.iloc[i,1]=regexdf.iloc[i,1]
        stpdf.iloc[i,2]=regexdf.iloc[i,2]
        
        words = regexdf.iloc[i,3].split()
        str_list = []
        for r in words:
            if not r in stop_word:
                str_list.append(r)
        stpdf.iloc[i,3]=" ".join(str_list)
        
        
    
#    stpdf.to_csv('D:/Working/Auto-sub cat modelling/SVM/SVM/stopword_cleaned.csv', encoding='utf-8')
    
    # =============================================================================
    # ##stemming
    # =============================================================================
    
    ps = PorterStemmer()
    #nltk.download('punkt')
    stmdf = pd.DataFrame(index=range(len(stpdf.index)), columns=["id","Meta","Transmeta","stem_cleaned"])
    stmdf = stmdf.fillna("")
    
    for i in range(len(stpdf.index)):
        stmdf.iloc[i,0]=stpdf.iloc[i,0]
        stmdf.iloc[i,1]=stpdf.iloc[i,1]
        stmdf.iloc[i,2]=stpdf.iloc[i,2]
        
        words = word_tokenize(stpdf.iloc[i,3].decode('utf8'))
        wrd=[]
        for w in words:
            wrd.append(ps.stem(w).encode('utf8'))
        stmdf.iloc[i,3]=" ".join(wrd)
        
        
#    stmdf.to_csv('D:/Working/Auto-sub cat modelling/SVM/SVM/stem_cleaned.csv', encoding='utf-8')
    
    fnldf = pd.DataFrame(index=range(len(stmdf.index)), columns=["id","Meta","Transmeta","CleanMeta"])
    fnldf = fnldf.fillna("")
    
    ### Final Cleaning###
    for i in range(len(stmdf.index)):
        fnldf.iloc[i,0]=stmdf.iloc[i,0]
        fnldf.iloc[i,1]=stmdf.iloc[i,1]
        fnldf.iloc[i,2]=stmdf.iloc[i,2]
        
        words = stmdf.iloc[i,3].split()
        str_list = []
        for r in words:
            if len(r)>1:        
                str_list.append(r)
            else:
                if len(re.sub('[0-9 ]+', '', r))==0:
                    str_list.append(r)
        fnldf.iloc[i,3]=" ".join(str_list)
        
    return fnldf

